package Functional;

public class switchst {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a = 1;
		switch(a) {
		case 1:
			System.out.println("Perfect");
			break;
		case 2:
			System.out.println("Good");
			break;
			
		case 3:
			System.out.println("High");
			break;
			
		}

	}

}
